import React, { useState, useEffect } from 'react';
import { Container, Paper, TextField, Button, Box, Typography, List, ListItem, ListItemText, Divider } from '@mui/material';
import io from 'socket.io-client';
import './App.css';

const socket = io('http://localhost:5001');

function App() {
  const [username, setUsername] = useState('');
  const [message, setMessage] = useState('');
  const [messages, setMessages] = useState([]);
  const [users, setUsers] = useState([]);
  const [isJoined, setIsJoined] = useState(false);

  useEffect(() => {
    socket.on('message', (message) => {
      setMessages((msgs) => [...msgs, message]);
    });

    socket.on('userList', (userList) => {
      setUsers(userList);
    });

    return () => {
      socket.off('message');
      socket.off('userList');
    };
  }, []);

  const handleJoin = (e) => {
    e.preventDefault();
    if (username.trim()) {
      socket.emit('join', username);
      setIsJoined(true);
    }
  };

  const handleSendMessage = (e) => {
    e.preventDefault();
    if (message.trim()) {
      socket.emit('message', message);
      setMessage('');
    }
  };

  if (!isJoined) {
    return (
      <Container maxWidth="sm">
        <Box sx={{ mt: 8, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <Paper elevation={3} className="join-form">
            <Typography variant="h5" component="h1" gutterBottom>
              Join Chat
            </Typography>
            <form onSubmit={handleJoin}>
              <TextField
                fullWidth
                label="Enter your username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                margin="normal"
              />
              <Button
                type="submit"
                fullWidth
                variant="contained"
                className="join-button"
                sx={{ mt: 2 }}
              >
                Join
              </Button>
            </form>
          </Paper>
        </Box>
      </Container>
    );
  }

  return (
    <Container maxWidth="md">
      <Box sx={{ mt: 4, display: 'flex', gap: 2 }}>
        <Box sx={{ flex: 1 }}>
          <Paper elevation={3} className="chat-container" sx={{ p: 2, height: '70vh', display: 'flex', flexDirection: 'column' }}>
            <Typography variant="h6" gutterBottom>
              Chat Room
            </Typography>
            <List className="message-list" sx={{ flex: 1, overflow: 'auto', mb: 2 }}>
              {messages.map((msg, index) => (
                <React.Fragment key={index}>
                  <ListItem className={`message-item ${msg.user === 'System' ? 'system' : ''}`}>
                    <ListItemText
                      primary={msg.text}
                      secondary={`${msg.user} - ${new Date(msg.timestamp).toLocaleTimeString()}`}
                    />
                  </ListItem>
                  <Divider />
                </React.Fragment>
              ))}
            </List>
            <form onSubmit={handleSendMessage} className="message-form">
              <TextField
                fullWidth
                value={message}
                onChange={(e) => setMessage(e.target.value)}
                placeholder="Type a message"
                variant="outlined"
                size="small"
              />
              <Button type="submit" variant="contained" className="send-button">
                Send
              </Button>
            </form>
          </Paper>
        </Box>
        <Paper elevation={3} className="user-list" sx={{ p: 2, width: 200 }}>
          <Typography variant="h6" gutterBottom>
            Online Users
          </Typography>
          <List>
            {users.map((user, index) => (
              <ListItem key={index} className="user-item">
                <ListItemText primary={user} />
              </ListItem>
            ))}
          </List>
        </Paper>
      </Box>
    </Container>
  );
}

export default App;
